/*import css files*/
import "./Loginformulier.css";

const Loginformulier = () => {
    return (
        <div className="loginwrapper">
            <form action="">
                <div className="name">
                    <label htmlFor="" className="name__label">Name</label>
                    <input type="text" className="name__input"  placeholder="Name"/>
                </div>
                <div className="email">
                    <label htmlFor="" className="emial__label">Email</label>
                    <input type="text"  className="emial__input" placeholder="Email"/>
                </div>
                <div className="wachtword">
                    <label htmlFor="" className="emial__label">Email</label>
                    <input type="text"  className="emial__input" placeholder="Email"/>
                </div>
            </form>
        </div>
    )
}

export default Loginformulier;
